import Character from "./Character";

const CharacterList = (props) => {
  const userElements = props.result.map((results) => {
    return (
      <li key={result.id}>
        <Character character={result.name} />
      </li>
    );
  });
  return (
    <section>
      <ul className="cards"></ul>
    </section>
  );
};

export default CharacterList;
